import React from 'react';
import PokeList from './components/PokeList';
import {pokemon} from './components/Array';
import './App.css';

class App extends React.Component {

  constructor(props) {
    super(props);

    this.state = {
      poke: pokemon
    }
  }

  handleChose (event) {
    const pokSelected = event.currentTarget;
    console.log(pokSelected);
  }

  render () {
    return (
      <div className="app">
      <h1 className="app__title">Mi lista de pokemon</h1>
      <PokeList 
        pokemon={this.state.poke}
      />
      </div>
    );
  }

}

export default App;
